            <div id="logo">
                <img src={logo} class = "logo" alt=""/>
            </div>
            <nav class="navbar navbar-light bg-light">

                <a class="menu" href="#">Home</a> 
                <a class="menu" href="#Portifolio">Portifolio</a> 
                <a class="menu" href="#Contato">Contato</a>
            </nav> 
        </div>
    )
}

export default Header;
